import React from 'react';
import { View, Text, Image  } from 'react-native';
import Icon from 'react-native-vector-icons/AntDesign';
import { Button, Card } from 'react-native-elements';



export default function Home() {
    return (
        <View style={{ display: "flex", flex: 1, alignItems: "center" }}>
            <View style={{ marginTop: 20, alignSelf: "stretch", display: "flex", alignItems: "center" }}>
                <Text style={{ fontSize: 18, fontWeight: "bold" }}>New User Here?</Text>
                <Icon style={{ color: '#F4D03F', marginTop: 20, fontSize: 40 }} name="smile-circle" />
                <Text
                    style={{ marginHorizontal: 80, textAlign: "center", marginVertical: 20 }}>Please create an account or log in to make your booking
                </Text>
                <Button title="Sign up"></Button>
                <Button title="Log in" containerStyle={{ margin: 10 }} type="outline"></Button>
                <Card>
                    <Card.Title>What's New</Card.Title>
                    <Card.Divider />
                    <Image source={require('./Images/news.jpg')} style={{alignSelf:"center",width:320}}/>
                    <Text style={{ margin: 5,alignSelf:"center" }}>
                        What is the news here ... ?
                    </Text>
                   
                </Card>
            </View>
        </View>
    );
}
